import React, { useEffect, useState } from 'react'
import '../styles/NewSession.css'

const NewSession = ({API_URL, onShow, session, setSession, exercisesSession, setExercisesSession, exercises}) => {
  const [index, setIndex] = useState(0)
  /*const [exercisesSession, setExercisesSession] = useState([{}])*/
  const [emptyExercise, setEmptyExercise] = useState(
    {
      exerciseId: 0,
      name: '',
      series: 0,
      minReps: 0,
      maxReps: 0,
      rest: 0,
      RIR: 0,
      observations: ''
    }
  )
  const [leftButton, setLeftButton] = useState('empty')
  const [rightButton, setRightButton] = useState('add')

  const onSubmit = (e) => {
    e.preventDefault()

    //addSession(session)
  }

  const handleSession = (key, value) => {
    const updatedSession = {}
    updatedSession[key] = value

    setSession({
      ...session,
      ...updatedSession
    })
  }

  /*const handleExerciseSession = (key, value) => {
    const updatedExerciseSession = {}
    updatedSession[key] = value

    setSession({
      ...session,
      ...updatedSession
    })
  }*/

  const handleLeftButton = () => {
    setIndex(index-1)
    if(exercisesSession.length > 1 && index == exercisesSession.length) {
      setLeftButton('arrow')
    }
  }

  const handleRightButton = () => {
    setExercisesSession(
      ...exercisesSession,
      ...emptyExercise
    )
    setIndex(index+1)
    if(exercisesSession.length > 1 && index < exercisesSession.length) {
      setRightButton('arrow')
    }
  }

  return (
    <div className='form-container'>
      <form onSubmit={onSubmit}>
        <div className='form-body'>
          <input 
            required={true}
            type='text'
            placeholder='Nombre'
            value={session.name}
            onChange={(e) => handleSession('name', e.target.value)}
          />

          <textarea
            className='description-field'
            placeholder='DescripciÃ³n'
            type='text'
            value={session.description}
            onChange={(e) => handleSession('description', e.target.value)}
          />

          <div className="card text-center">
            <div className="card-header">
              <ul className="nav nav-tabs card-header-tabs">
                <li className="nav-item">
                  <h5 className="nav-link active" style={{fontWeight:'bold'}}>{exercisesSession[index].name}</h5>
                </li>
              </ul>
            </div>
            <div className="card-body">
              <div className='card-button'>
                {leftButton === 'arrow' ? (
                  <svg onClick={() => handleLeftButton()} xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-caret-left-fill" viewBox="0 0 16 16">
                    <path d="m3.86 8.753 5.482 4.796c.646.566 1.658.106 1.658-.753V3.204a1 1 0 0 0-1.659-.753l-5.48 4.796a1 1 0 0 0 0 1.506z"/>
                  </svg>
                ) :
                (
                  <></>
                )}
              </div>

              <div className='card-info'>
                <select>
                  <option value='' defaultValue disabled>Seleccione</option>
                  {/*exercises.map(exercise => (
                    <option key={exercise.id}>{exercise.fullName}</option>
                  ))*/}
                </select>
                <div className="card-row">
                  <label>Series:</label>
                  <input 
                    required={true}
                    min='1'
                    type='number'
                    value={exercisesSession[index].series}
                    onChange={(e) => handleSession('series', e.target.value)}
                  />
                </div>

                <div className="card-row">
                  <label>Reps:</label>
                  <input 
                    required={true}
                    min='1'
                    type='number'
                    value={exercisesSession[index].minReps}
                    onChange={(e) => handleSession('minReps', e.target.value)}
                  />
                  <label>-</label>
                  <input 
                    required={true}
                    min='0'
                    type='number'
                    value={exercisesSession[index].maxReps}
                    onChange={(e) => handleSession('maxReps', e.target.value)}
                  />
                </div>

                <div className="card-row">
                  <label>RIR:</label>
                  <input 
                    required={true}
                    min='1'
                    type='number'
                    value={exercisesSession[index].RIR}
                    onChange={(e) => handleSession('RIR', e.target.value)}
                  />
                </div>

                <div className="card-row">
                  <label>Descanso:</label>
                  <input 
                    required={true}
                    min='1'
                    type='number'
                    value={exercisesSession[index].rest}
                    onChange={(e) => handleSession('rest', e.target.value)}
                  />
                </div>
              </div>

              <div className='card-button'>
                {rightButton === 'add' ? (
                  <svg onClick={() => handleRightButton()} xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-plus-circle" viewBox="0 0 16 16">
                    <path d="M8 15A7 7 0 1 1 8 1a7 7 0 0 1 0 14zm0 1A8 8 0 1 0 8 0a8 8 0 0 0 0 16z"/>
                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4z"/>
                  </svg>
                ) :
                (
                  <svg onClick={() => handleRightButton()} xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-caret-right-fill" viewBox="0 0 16 16">
                    <path d="m12.14 8.753-5.482 4.796c-.646.566-1.658.106-1.658-.753V3.204a1 1 0 0 1 1.659-.753l5.48 4.796a1 1 0 0 1 0 1.506z"/>
                  </svg>
                )}
              </div>
            </div>
          </div>
        </div>
      </form>      
    </div>
  )
}

export default NewSession
